package com.example.fptacademysystem.dto;import java.io.Serializable;public class CampusDTO implements Serializable {    private int campusid;    private String campusnm;    public CampusDTO() {        super();    }    public int getCampusid() {        return campusid;    }    public void setCampusid(int campusid) {        this.campusid = campusid;    }    public String getCampusnm() {        return campusnm;    }    public void setCampusnm(String campusnm) {        this.campusnm = campusnm;    }}